// ==UserScript==
// @name         Better Spotify PiP
// @namespace    http://tampermonkey.net/
// @version      1.0.0
// @description  overrides the old spotify pip feature with a new one that is much more helpful
// @author       You
// @match        https://open.spotify.com/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=spotify.com
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/494968/Better%20Spotify%20PiP.user.js
// @updateURL https://update.greasyfork.org/scripts/494968/Better%20Spotify%20PiP.meta.js
// ==/UserScript==

(function() {
    'use strict';
    let canvas, ctx, vid, logo, coverImg, pipButton, t = 0;

    function init() {
        // Initialize the canvas that will Show the improved PIP
        canvas = document.createElement("canvas");
        canvas.width = 1000;
        canvas.height = 256;
        canvas.hidden = true;
        ctx = canvas.getContext("2d");

        // Only video elements can be placed into PIP so make one that copies the canvas
        vid = document.createElement("video");
        vid.muted = true;
        vid.srcObject = canvas.captureStream();
        vid.load();
        vid.play();

        // Spotify attribution logo
        logo = new Image();
        logo.crossOrigin = "anonymous";
        logo.src = logoSRC;
        logo.aspect = 709/2362;

        // Song cover picture
        // The image is set in the begging of the draw function
        coverImg = new Image();
        coverImg.crossOrigin = "anonymous";

        // Override the picute in picture button so it opens the new GUI
        let oldPipButton = getDTIDElem("pip-toggle-button");
        pipButton = oldPipButton.cloneNode(true);
        oldPipButton.parentNode.replaceChild(pipButton, oldPipButton);
        pipButton.addEventListener("click", openPIP);

        // Run the draw function to update the PIP display
        // Runs every tenth of a second
        setInterval(draw, 100);

        // Debug init message
        console.log("initiated PIP+");
    }

    // Gets the link to an hd version of the cover image
    function getCoverSrc() {
        // locates the low res version's url
        const lowres = document.querySelector("[data-testid='cover-art-image']").src;

        // replaces a section of the url to ensure that the high res version is loaded
        return [lowres.slice(0, 36) + "1e02" + lowres.slice(40)].join("");
    }

    // Just a faster way of querying for elements using the data-testid property
    function getDTIDElem(data) {
        return document.querySelector(`[data-testid="${data}"]`);
    }

    // Reads the text content of the song to determine name and author
    function getSongDetails() {
        return {
            name: getDTIDElem("context-item-link").textContent,
            artist: getDTIDElem("context-item-info-artist").textContent,
        };
    }

    // Update PIP image
    function draw() {
        // t value is used for animations such as long text scrolling
        t += 1;

        // update cover image
        coverImg.src = getCoverSrc();

        // Button classes that make the pip button turn green when pip is opened
        const cVal = "Button-sc-1dqy6lx-0 hidZeW KAZD28usA1vPz5GVpm63 RK45o6dbvO1mb0wQtSwq EHxL6K_6WWDlTCZP6x5w";
        const ncVal = "Button-sc-1dqy6lx-0 hidZeW KAZD28usA1vPz5GVpm63";

        // apply the proper class if pip is opened
        if(document.pictureInPictureElement == null) pipButton.className = ncVal;
        else pipButton.className = cVal;

        // Background
        ctx.fillStyle = "#000000";
        ctx.fillRect(0, 0, canvas.width, canvas.height);

        // Song Name
        const dts = getSongDetails();
        ctx.textBaseline = "bottom";
        ctx.fillStyle = "#FFFFFF";
        ctx.font = "60px Arial";

        // Scrolling large name
        const off = ctx.measureText(dts.name).width - 740;
        if(off > 0) {
            ctx.fillText(dts.name, 256 - (Math.min(Math.max(Math.sin(t/50) * 1.5, -1), 1) + 1) / 2 * off, 120);
        } else {
            ctx.fillText(dts.name, 256, 120);
        }

        // Song Artist
        ctx.textBaseline = "top";
        ctx.fillStyle = "#A7A7A7";
        ctx.font = "32px Arial";
        ctx.fillText(dts.artist, 256, 136);

        // Progress bar
        const progress = getDTIDElem("progress-bar").style.getPropertyValue("--progress-bar-transform").slice(0, -1);
        ctx.fillStyle = "#191414";
        ctx.fillRect(256, 236, 734, 10);

        ctx.fillStyle = "#FFFFFF";
        ctx.fillRect(256, 236, 7.34 * progress, 10);

        // Cover Image
        ctx.drawImage(coverImg, 10, 10, 236, 236);
        ctx.drawImage(logo, 858, 10, 132, 132 * logo.aspect);
    }

    // toggles pip
    function openPIP() {
        if(document.pictureInPictureElement == null) vid.requestPictureInPicture();
        else document.exitPictureInPicture();
    }

    // repeatedly checks if the picture in picture button is loaded
    let intId = setInterval(()=>{
        if(getDTIDElem("pip-toggle-button") != null) {
            // if it is loaded, it stops checking and runs init()
            clearInterval(intId);
            init();
        }
    });

    // hard coded logo data because the CORS policy was rejecting a request from spotify.com

    // Logo came from:
    // https://newsroom.spotify.com/media-kit/logo-and-brand-assets/

    // Logo src:
    // https://storage.googleapis.com/pr-newsroom-wp/1/2018/11/Spotify_Logo_RGB_Green.png

    const logoSRC = "data:image/png;b ase64,";
})();